Here's one way to write a Python program to print out the first 100 prime numbers:
```python
def is_prime(n):
    if n <= 1:
        return False
    elif n == 2:
        return True
    else:
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

count = 0
num = 2
while count < 100:
    if is_prime(num):
        print(num)
        count += 1
    num += 1
```

This program defines a function `is_prime` that checks whether a given number is prime. It then uses a while loop to iterate over numbers starting from 2, checking each one with the `is_prime` function and printing it if it's prime. The loop stops after finding and printing the first 100 prime numbers.

Note: This program could be optimized further by using more advanced algorithms for generating primes or by implementing a sieve to precompute all primes up to a certain limit. However, this version should suffice for small inputs like the first 100 prime numbers.
